metadataTemplate:
---
url: {{url}}
{% if author %}
author: {{author}}
{% endif %}
{% if publisher %}
publisher: {{publisher}}
{% endif %}
{% if published_date %}
published at: {{published_date|date("YYYY-MM-DD")}}
{% endif %}
{% if note %}
note: {{note}}
{% endif %}
{% if tags %}
tags: {% for tag in tags %}#{{tag | replace(' ', '_')}}{% if not loop.last %}, {% endif %}{% endfor%}
{% endif %}

---
